import "./topbar.scss";
import {Person} from "@material-ui/core"

export default function Topbar() {
  return (
    <div className="topbar">
      <div className="wrapper">
        <div className="left">
          <a href="#intro" className="logo">genius.</a>
          <div className="itemContainer">
            <Person/>

          </div>
        </div>
        <div className="right"> </div>
      </div>
    </div>
  );
}
